import React from 'react';
import './Login.css';
import { Link, Route } from 'react-router-dom';
import About from '../about/about';


export const Login = () => {
  return (
    <div>
        <div className='Loginpage'>
<nav>
  <ul>Login</ul>
  <ul><Link path="/about">About</Link></ul>
</nav>
<Route path="/about" element={<About />} />
        </div>

    </div>
  )
}
export default Login;
